import React from 'react'
import { useSelector } from 'react-redux'

const Cart = () => {
  const items = useSelector(state => state.Cart)
  console.log(items)
  return (
    <div>
      <h2>My Shopping Cart</h2>

    </div>
  )
}

export default Cart
